B.a2A=new A.e7(3,"Les Accusations : Comment g\xe9rez-vous la situation ?",'En revenant vers le service IT, vous entendez une dispute. Un cadre pointe du doigt un technicien :\n\n"C\'est TOI qui as plant\xe9 le serveur ! Tu es le seul qui y touche !"\n\nLe technicien nie, paniqu\xe9. Le cadre insiste.\n\nMais quelque chose cloche\u2026 Les \xe9v\xe9nements semblent trop coordonn\xe9s pour \xeatre une simple erreur humaine.',B.VM,"gestion de conflit, m\xe9thode d'investigation.")
